import React from 'react';
import './navigation.css';

function navigation() {
    return (
        <>
        <h1>Bradley Vangelder</h1>
        <div className="navigatie">
            <ul>
                <li><a href="/#">About</a></li>
                <li><a href="/#">Contact</a></li>
                <li><a href="/#">Resume</a></li>
            </ul>
        </div>
        </>
    )
}

export default navigation;
